INSERT INTO `ps_cms_lang` VALUES
('1','1','1','Dostawa',NULL,'conditions, delivery, delay, shipment, pack','<h2>Cennik dostawy:</h2>\n<p>Nasz sklep oferuje 2 formy dostawy:</p>\n<p>        - odbiór osobisty - 0zł</p>\n<p>        - wysłkę kurierską - W tym przypadku koszt dostawy uzależniony jest od wartości zamówienia.<span style=\"font-family:\'Open Sans\', Arial, sans-serif;font-size:14px;text-align:justify;\"> <br /></span></p>\n<p>Zamówienia:</p>\n<p>poniżej 2000zł - koszt dostawy 15,99zł</p>\n<p>2000zł lub więcej - koszt dostawy 0zł</p>\n<p><span style=\"font-family:\'Open Sans\', Arial, sans-serif;font-size:14px;text-align:justify;\"></span></p>\n<p></p>\n<p></p>','delivery'),
('3','1','1','Regulamin użytkowania',NULL,'conditions, terms, use, sell','<h2>Regulamin</h2>\n<h3>1</h3>\n<p><span style=\"font-family:\'Open Sans\', Arial, sans-serif;font-size:14px;text-align:justify;\">Nasz sklep akceptuje zwroty od klientów bez podania przyczyny. Jeżeli towar jest w stanie nienaruszonym i nadaje się do ponownej odsprzedaży, to masz 14 dni na jego zwrot.<br /></span></p>\n<h3>2</h3>\n<p><span style=\"font-family:\'Open Sans\', Arial, sans-serif;font-size:14px;text-align:justify;\">Na wszystkie produkty oferowane w sklepie udzielamy gwarancji 24 miesiące.<br /></span></p>\n<h3>3</h3>\n<p><span style=\"font-family:\'Open Sans\', Arial, sans-serif;font-size:14px;text-align:justify;\">Sklep Cegiełka nie ponosi żadnej odpowiedzialności za niewłaściwe użytkowanie produktów.<br /></span></p>','terms-and-conditions-of-use'),
('4','1','1','O nas',NULL,'about us, informations','<h2>Cegiełka - Twój sklep budowlany</h2>\n<pre>Każdego dnia dokładamy wszelkich starań, aby materiały dostarczane na Państwa budowy docierały na czas.</pre>','about-us');
